import React from "react";
import styled from "styled-components";
import SubjectItem from "./SubjectItem";

const SubjectListBlock = styled.div`
  flex: 1;
  padding: 20px 32px;
  padding-bottom: 48px;
  overflow-y: auto;
`;

function SubjectList() {
  return (
    <SubjectListBlock>
      <SubjectItem text="프로젝트 생성하기" done={true} />
      <SubjectItem text="컴포넌트 스타일링 하기" done={true} />
      <SubjectItem text="Context 만들기" done={false} />
      <SubjectItem text="기능 구현하기" done={false} />
    </SubjectListBlock>
  );
}

export default SubjectList;
